class Leet152 {

    class Solution {

        fun maxProduct(nums: IntArray): Int {
            val size = nums.size
            val lastElement = size - 1
            var l = 0
            var r = 0
            var max = nums[0]

            while (r < size) {
                val prod = calcOnly(l, r, nums)
                max = maxOf(max, prod)
                if (prod == 0) {
                    max = maxOf(max, maxOfHead(l, r - 1, nums))
                    l = r + 1
                    r = l
                } else {
                    r++
                }
            }
            max = maxOf(max, maxOfHead(l, r, nums))

            return max
        }

        private fun calcOnly(l: Int, r: Int, nums: IntArray): Int {
            val rr = minOf(r, nums.size - 1)
            var result = nums[l]
            var i = l + 1
            while (i <= rr) {
                result *= nums[i]
                i++
            }
            return result
        }

        private fun maxOfHead(l: Int, r: Int, nums: IntArray): Int {
            var ll = minOf(l + 1, nums.size - 1)
            var rr = maxOf(r, 0)
            var max = nums[ll]
            while (ll < rr) {
                max = maxOf(max, calcOnly(ll, rr, nums))
                ll++
            }
            return max
        }
    }


